export default {
  "title": "rRNADif",
  "tagline": "Make 16S great again",
  "url": "https://pavlohrab.github.io",
  "baseUrl": "/rRNADif-docs/",
  "onBrokenLinks": "throw",
  "onBrokenMarkdownLinks": "warn",
  "favicon": "img/logo.gif",
  "organizationName": "pavlohrab",
  "projectName": "rRNADif-docs",
  "themeConfig": {
    "navbar": {
      "title": "rRNADif",
      "logo": {
        "alt": "My Site Logo",
        "src": "img/logo.gif"
      },
      "items": [
        {
          "to": "docs/",
          "activeBasePath": "docs",
          "label": "Docs",
          "position": "left"
        },
        {
          "href": "https://github.com/pavlohrab/rRNADif",
          "label": "GitHub",
          "position": "right"
        }
      ],
      "hideOnScroll": false
    },
    "footer": {
      "style": "dark",
      "links": [
        {
          "title": "Docs",
          "items": [
            {
              "label": "Introduction",
              "to": "docs/"
            },
            {
              "label": "Installation",
              "to": "docs/installation"
            }
          ]
        },
        {
          "title": "Guides",
          "items": [
            {
              "label": "Get started",
              "to": "docs/get_started"
            }
          ]
        },
        {
          "title": "More",
          "items": [
            {
              "label": "GitHub",
              "href": "https://github.com/pavlohrab/rRNADif"
            }
          ]
        }
      ],
      "copyright": "Copyright Â© Pavlo Hrab. Built with Docusaurus."
    },
    "colorMode": {
      "defaultMode": "light",
      "disableSwitch": false,
      "respectPrefersColorScheme": false,
      "switchConfig": {
        "darkIcon": "ðŸŒœ",
        "darkIconStyle": {},
        "lightIcon": "ðŸŒž",
        "lightIconStyle": {}
      }
    },
    "docs": {
      "versionPersistence": "localStorage"
    },
    "metadatas": [],
    "prism": {
      "additionalLanguages": []
    },
    "hideableSidebar": false
  },
  "presets": [
    [
      "@docusaurus/preset-classic",
      {
        "docs": {
          "sidebarPath": "/run/media/pavloh/DATA_BANK/WORK/rRNADif-docs/sidebars.js",
          "editUrl": "https://github.com/pavlohrab/rRNADif-docs"
        },
        "blog": {
          "showReadingTime": true,
          "editUrl": "https://github.com/pavlohrab/rRNADif-docs"
        },
        "theme": {
          "customCss": "/run/media/pavloh/DATA_BANK/WORK/rRNADif-docs/src/css/custom.css"
        }
      }
    ]
  ],
  "onDuplicateRoutes": "warn",
  "customFields": {},
  "plugins": [],
  "themes": [],
  "titleDelimiter": "|",
  "noIndex": false
};
